function findVariableName(input) {
    var name = ""

    name = values.find((el) => {
        return el.id === input
    });
    try {
        return name.name;
    } catch (error) {
        return false;
    }
}
function findVariableUnit(input) {
    var name = ""

    name = values.find((el) => {
        return el.id === input
    });
    try {
        return name.unit;
    } catch (error) {
        return false;
    }
}



